package winter_holidays;

public class printseries {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	   int i=1;
	   int n=4;
	   while(i<(3*n)+2)
	   {
		   if(((3*i)+2)%n!=0)
		   {
			   System.out.println((3*i)+2);
		   }
		   i++;
	   }

	}
	

}
